    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

.remark__tile-view {
background: lightgray;
position: relative;
width: 100%;
height: 100%;
padding: 3em;
font-size: 18px;
box-sizing: border-box;
overflow: scroll;
}
.remark__tile-view__header {
text-align: center;
}
.remark__tile-view__tiles {
display: grid;


justify-items: center;
}
.remark__tile-view__tile {
position: relative;
margin: 0.5em;
padding: 0.5em;
}
.remark__tile-view__slide-container {
margin: 0 auto;
}
.remark__tile-view__tile--current {
background: #ffd863;
border: 5px solid #ffd863;
margin: calc(0.5em - 5px);
border-radius: 0;
}
.remark__tile-view__tile--seen {
opacity: 0.5;
}
.remark__tile-view__tile:hover {

background: #44bc96;

}

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

# Bias

Inherently, bias exists relative to some unbiased baseline. In studies of information processing, Bayesian updating is often erroneously used as a synonym for unbiased processing.

- Cognitive bias. A cognitive bias is a systematic and widely exhibited error in reasoning. This bias is relative to a norm of rationality; for example, the tendency to overestimate the frequency of an event that easily comes to mind (plane accidents, for example).

- Directional bias. A directional bias is the result of having a directional goal, with consequent effects on information processing, and exists relative to accuracy-motivated information processing. For example, a belief-protective goal may result in confirmation bias, disconfirmation bias or a prior attitude effect. Finally, a priors bias refers to the influence of prior information, beliefs, dispositions or values on information processing. 

- Priors bias. A priors bias can be a directional bias, but is not necessarily soâa priors bias includes the influence of any standing belief, such as an assessment of whether a source (such as a corporate sponsor) is trustworthy. This is a bias relative to a situation where priors do not affect processing. Note that the influence of priors on information processing is not only compatible with an accuracy motivation, it has been described as ârationalâ86 and âessentialâ81 to learning.

# Taber &amp; Lodge (2006) - baggrund

Elegant design! Vi ser pÃ¥ eksempler

Our starting premise (followingKunda 1987, 1990) is that
all reasoning is motivated. While citizens are always constrained
in some degree to be accurate, they are typically
unable to control their preconceptions, even when encouraged
to be objective. This tension between the drives
for accuracy and belief perseverance underlies all human
reasoning. Keeping it simple and focusing on reasoning
about things political, citizens are goal oriented
(Chaiken and Trope 1999). Their motives fall into two
broad categories: accuracy goals, which motivate them to
seek out and carefully consider relevant evidence so as to
reach a correct or otherwise best conclusion (Baumeister
and Newman 1994; Fiske and Taylor 1991), and partisan
goals, which motivate them to apply their reasoning powers
in defense of a prior, specific conclusion (Kruglanski
andWebster 1996). In our theory, partisan goals and subsequent
selective information processing are driven by automatic
affective processes that establish the direction and
strength of biases (Lodge and Taber 2005; Taber, Lodge,
and Glathar 2001).

Selective information processes are particularly important
because of their impact on subsequent attitudes
and behavior and because of their implications for the distribution
of aggregate public opinion (Zaller 1992).

# Taber &amp; Lodge (2006) - hypoteser 

H1: a prior attitude effect, whereby people who feel
strongly about an issueâeven when encouraged to be
objective and leave their preferences asideâwill evaluate
supportive arguments as stronger and more compelling
than opposing arguments;
H2: a disconfirmation bias, such that people will spend
more time and cognitive resources denigrating and
counterarguing attitudinally incongruent than congruent
arguments; and
H3: a confirmation bias, such that when free to
choose what information they will expose themselves
to people will seek out confirming over disconfirming
arguments.

H4: attitude polarization,whereby attitudeswill become
more extreme, even when people have been exposed to
a balanced set of pro and con arguments.

H5: an attitude strength effect, such that those citizens
voicing the strongest policy attitudeswill be most prone
to motivated skepticism; and

H6: a sophistication effect, such that the politically
knowledgeable, because they possess greater ammunition
with which to counterargue incongruent facts,
figures, and arguments,will be more susceptible to motivated
bias than will unsophisticates.

# The motivated reasoning observational equivalence problem



- Although both directional and non-directional goals can influence judgments, researchers typically use the **term âmotivated reasoningâ** to refer implicitly or explicitly to directional goals (Bayes &amp; Druckman 2021)

- De har en helt central pointe



- Evidence for directional motivated reasoning requires documentation
that an individual possesses a directional goal and that information
processing is tailored to achieve that goal. 

- The climate change literature offers suggestive
(but little definitive) evidence that directional motivated reasoning
occurs. Despite claims of pervasive directional motivated reasoning,
most of the data are also consistent with an accuracy-motivated
updating process.


Distinguishing these alternative processes is difficult because the
very sources people find credible are the ones with whom they share
common beliefs26,27. When individuals seek advice from sources
that share their views, it could be to achieve a directional processing
goal28, or it could be because they believe that source to be the most
credible, regardless of their views on the issue at hand. This is the
motivated reasoning observational equivalence problem.
